import React from 'react';
import {ImageBackground, StyleSheet} from 'react-native';

export default function Background() {
  return (
    <ImageBackground
      source={require('../images/ARTWEB_Logo.jpg')}
      style={[styles.container]}
    />
  );
}

const styles = StyleSheet.create({
  container: {
    resizeMode: 'streched',
    width: 400,
    height: 100,
    marginTop: 3,
  },
});
